import React from 'react';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Posts from './posts';

function Header (props) {
    return(
    <div>
    <Navbar className = "bootstrap-navbar">
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Brand className = "header" href="#home">Scotty Designs</Navbar.Brand>
    {/* <h1 className = "header">Scotty Designs</h1> */}
        <button className = "navbar-toggler" type = "button" onClick = {
            () => {
          return props.onClick();
        }}>
        {(() =>{
            switch(props.buttonText){
                case true: return "Posts";
                case false: return "Home Page";
            }}
        )()}
        </button>
        {/* <Navbar.Link href="#Posts">Link</Navbar.Link> */}
        </Navbar>

    </div>)
};
export default Header;
